import React from 'react';
import { useAuth } from './AuthContext';

const Navbar = () => {
  const { currentUser, logout } = useAuth();

  return (
    <nav className="bg-blue-500 p-4">
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-white text-xl">My App</div>
        <div>
          {currentUser ? (
            <>
              <span className="text-white">Welcome, {currentUser.username}</span>
              <button onClick={logout} className="ml-4 bg-red-500 text-white p-2 rounded">
                Logout
              </button>
            </>
          ) : (
            <button className="bg-green-500 text-white p-2 rounded">Login</button>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
